      <BrowserRouter>
        <p>Happy hacking!</p>
        <Route path='/registration' component={Registration}/>
        {/* <a><NavLink to="/login"/>Логин</a> */}
        {/* <p><NavLink to="/registration"/>Регистрация</p> */}
      </BrowserRouter>
  );
}

export default App;
